const Item = (props) => {
  // const imgUrl =
  return (
    <Card elevation={0} sx={{ background: "none" }}>
      <CardMedia
        component="img"
        height="90"
        width="100%"
        image={`../../assets/${props.img}`}
        style={styles.media}
        align="center"
      />
      <CardContent>
        <Typography  variant="body2" color="white" align="center">
          {props.title}
        </Typography>
      </CardContent>
    </Card>
  );
};

function CardTiers() {
  return (
    <Box m={10}>
        <Typography variant="h4" color="white" display="block" align="center">
        Card Tiers
        <br />
        <br />
      </Typography>
      <Stack
        direction={{ xs: 'column', sm: 'row' }}
        spacing={{ xs: 1, sm: 10, md: 10 }}
        justifyContent="center"
        alignItems="center"
      >
        <Item img="Group 13_90.png" title="DCP Platinum" />
        <Item img="Group 12_90.png" title="DCP Gold" />
        <Item img="Group 22_90.png" title="DCP Silver" />
        <Item img="Group 26_90.png" title="DCP Basic Elite" />
        {/*
        <Item img="Group 12.png" title="DCP Platinum" />
